import React from 'react';
import './App.css';

const ImageWithTextAndRays = () => {
  return (
    <div className="relative max-w-2xl mx-auto">
      {/* Контейнер для изображения */}
      <div className="relative w-full h-auto">
        {/* Вставьте ваше изображение здесь */}
        <img
          src="your-image.jpg" // Замените на путь к вашему изображению
          alt="Organic Food"
          className="w-full h-auto"
        />

        {/* Текст поверх изображения */}
        <div className="absolute top-1/2 left-1/2 transform -translate-x-1/2 -translate-y-1/2 text-white text-center z-10">
          <h1 className="text-3xl font-bold">NaturalProducts</h1>
          <p className="text-xl">ForLoversofHealthy</p>
          <p className="text-xl">OrganicFood</p>
        </div>

        {/* Лучи */}
        <div
          className="absolute inset-0 w-full h-full z-0"
          style={{
            transform: 'rotate(15.098deg)',
            opacity: 0.06,
            background: 'linear-gradient(180deg, #FFF 0%, rgba(255, 255, 255, 0.00) 100%)',
          }}
        ></div>
        <div
          className="absolute inset-0 w-full h-full z-0"
          style={{
            transform: 'rotate(15.098deg)',
            opacity: 0.04,
            background: 'linear-gradient(180deg, #FFF 0%, rgba(255, 255, 255, 0.00) 100%)',
          }}
        ></div>
      </div>
    </div>
  );
};

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <div className="bg-gray-200 p-4">
          <h1 className="text-xl">Welcome to my app!</h1>
        </div>
        <p>
          Edit <code>src/App.js</code> and save to reload.
        </p>

        {/* Добавление компонента с изображением и текстом */}
        <ImageWithTextAndRays />
      </header>
    </div>
  );
}

export default App;
